import React from 'react';
import Works from "./components/works/work";
import Contact from "./components/contact/contact";
import Scroll from "./components/scroll/scroll";
import './App.css';

function App() {
  return (
    <div className="App">
      <Scroll/>
      <Works/>
      <Contact/>
    </div>
  );
}

export default App;
